import pandas as pd
import numpy as np
# --- Data Processing ---
df = pd.read_csv("https://github.com/DAR-DatenanalyseRehberg/DDDD_Data-Driven-Dealings-Development/raw/main/RfmDash.csv")
df['Deviation_numeric'] = pd.to_numeric(df['Deviation'], errors='coerce')

numeric_cols = df.select_dtypes(include=np.number).columns.tolist()

# Es werden zwei Listen definiert: grouping_cols enthlt die Spalten, nach denen die Daten gruppiert werden, und agg_cols enthlt die Spalten, die aggregiert werden sollen (z.B. durch Mittelwertbildung).
# Die Liste agg_cols wird dynamisch erstellt, indem alle Gruppierungsspalten aus der Liste der numerischen Spalten entfernt werden.
grouping_cols = ['Model_Iteration_ID', 'Customer', 'ClusterCat', 'Deviation_numeric']

agg_cols = [col for col in numeric_cols if col not in grouping_cols]

processed_df = df.dropna(subset=['Deviation_numeric']).groupby(grouping_cols)[agg_cols].mean()
# Um die Daten fr eine Plotting-Bibliothek wie Plotly optimal vorzubereiten, wird der DataFrame von einem "breiten" in ein "langes" Format umgewandelt. Das geschieht mit der Methode stack(), die die Spaltennamen (agg_cols) in eine neue Zeilen-Ebene umwandelt.
sf = processed_df.stack()
# Das gestapelte Ergebnis ist eine Series, die wieder in einen DataFrame umgewandelt (pd.DataFrame(sf)) und der Index zurckgesetzt wird (reset_index). Dadurch werden die ehemaligen Index-Ebenen (Model_Iteration_ID, Customer, etc.) zu normalen Spalten.
processed_df = pd.DataFrame(sf).reset_index()
# Zum Abschluss werden die neuen, automatisch generierten Spaltennamen umbenannt, um sie aussagekrftiger zu gestalten:
# - level_4 wird zu Indicator Name (enthlt die ursprnglichen Spaltennamen wie 'Frequency', 'Recency').
# - 0 wird zu Value (enthlt die jeweiligen Mittelwerte).
processed_df.rename(columns={'level_4': 'Indicator Name', 0: 'Value', 'Model_Iteration_ID': 'CW'}, inplace=True)

