from dash import Dash, html, dcc, Input, Output
import plotly.express as px
# Initialisiert die Dash-App.
app = Dash(__name__, title='dash', update_title='GollnickData is updating..')

# Definiert das Layout der Webanwendung. html.Div ist ein Container fr die Elemente.
app.layout = html.Div([
    # berschrift fr das Dashboard.
    html.Div('RFM Dashboard.', style={'display': 'inline-block', 'height': '50px'}),

    # Erzeugt eine interaktive 3D-Grafik.
    # 'id' wird fr den Callback verwendet, um die Grafik zu aktualisieren.
    # 'config' entfernt das Plotly-Logo und die Modus-Leiste.
    dcc.Graph(
        id='scatter-3d',
        config={
            "displaylogo": False,
            'modeBarButtonsToRemove': []
        }
    ),

    # Ein einfacher Text, der den Nutzer anleitet.
    html.P("Please use the dropdowns to select the axes for the 3D plot."),

    # Ein Container fr die Dropdown-Mens.
    html.Div([
        # Dropdown-Men fr die X-Achse.
        # 'options' fllt das Men mit den eindeutigen Werten aus der 'Indicator Name'-Spalte.
        # 'value' setzt den Standardwert.
        # 'id' ist der Bezeichner fr den Callback.
        dcc.Dropdown(
            options=processed_df['Indicator Name'].unique(),
            value='Recency_Score_Value',
            id='xaxis-column'
        ),

        # Dropdown-Men fr die Y-Achse.
        dcc.Dropdown(
            options=processed_df['Indicator Name'].unique(),
            value='Monetary_Score_Value',
            id='yaxis-column'
        ),

        # Dropdown-Men fr die Z-Achse.
        dcc.Dropdown(
            options=processed_df['Indicator Name'].unique(),
            value='Frequency_Score_Value',
            id='zaxis-column'
        ),
    ]),
])

# --- Callback for 3D Plot ---
# Der Callback verbindet die Steuerelemente (Inputs) mit der Grafik (Output).
# Output: Aktualisiert die 'figure' der Grafik mit der ID 'scatter-3d'.
# Inputs: berwacht die 'value' der drei Dropdown-Mens.
@app.callback(
    Output('scatter-3d', 'figure'),
    Input('xaxis-column', 'value'),
    Input('yaxis-column', 'value'),
    Input('zaxis-column', 'value'))
def update_3d_scatter(xaxis_column_name, yaxis_column_name, zaxis_column_name):
    # Erstellt eine Kopie des DataFrames zur Vermeidung von nderungen am Original.
    dff = processed_df.copy()

    # Erzeugt ein interaktives 3D-Streudiagramm (scatter_3d) mit plotly.express.
    # Die Achsen (x, y, z) werden dynamisch basierend auf den ausgewhlten Dropdown-Werten zugewiesen.
    # 'color' frbt die Punkte basierend auf der 'ClusterCat'-Spalte ein.
    # 'hover_name' zeigt den Kundennamen beim Hovern ber einen Punkt an.
    fig_3d = px.scatter_3d(
        x=dff[dff['Indicator Name'] == xaxis_column_name]['Value'],
        y=dff[dff['Indicator Name'] == yaxis_column_name]['Value'],
        z=dff[dff['Indicator Name'] == zaxis_column_name]['Value'],
        color=dff[dff['Indicator Name'] == xaxis_column_name]['ClusterCat'],
        hover_name=dff[dff['Indicator Name'] == yaxis_column_name]['Customer'],
        labels={"color": dff[dff['Indicator Name'] == xaxis_column_name]['ClusterCat'].iloc[0]}
    )

    # Aktualisiert das Layout der Grafik.
    # 'margin' definiert den Rand um die Grafik.
    # 'hovermode' stellt sicher, dass der Hover-Text nur fr den nchstgelegenen Punkt angezeigt wird.
    # 'showlegend' blendet die Legende ein.
    # 'template' setzt ein sauberes, weies Hintergrund-Thema.
    fig_3d.update_layout(
        margin={'l': 40, 'b': 40, 't': 10, 'r': 0},
        hovermode='closest',
        showlegend=True,
        template="plotly_white"
    )

    # Gibt die fertige Grafik an den Output-Container der App zurck.
    return fig_3d

# Startet den Webserver der Dash-App.
# 'debug=True' ermglicht die automatische Aktualisierung bei Codenderungen.
if __name__ == '__main__':
    app.run(host="localhost", port=8050, debug=True, threaded=True)

